function GetLandTransfer(n,t){var i=GetSearchParam(n,t);HttpPost(`/Planning/List`,"html",i,function(n){$("#divLandTransferTable").html("");$("#divLandTransferTable").html(n)})}function GetSearchParam(n,t){return{name:"test",pageSize:parseInt(t),pageNumber:parseInt(n)}}function onPaging(n){GetLandTransfer(parseInt(n),currentPageSize);currentPageNumber=n}function onChangePageSize(n){GetLandTransfer(currentPageNumber,parseInt(n));currentPageSize=n}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){GetLandTransfer(currentPageNumber,currentPageSize)});